INSERT INTO `news_articles` VALUES (1,'PLAYSTATION 0 - XBOX 3','',_binary '<p>The fight for players is getting tougher. Who loses, the brands or the players, we think it\'s clear,</p><p>Three games that can only be played on PC, PS4 and PS5 are moving to Xbox One, Xbox Series S and Xbox Series X.</p><p>The first of these three games is The Pathless. The action-adventure game developed by Giant Squid, The Pathless, was released on November 12, 2020 as a PS5 game.</p><p>The second game is Solar Ash, released on December 2, 2021 and coming to us from the Heart Machine development team. The sci-fi action adventure had a good score of 78 on Metacritic.</p><p>The third and final game so far is Maquette from developer Graceful Decay. It was released in 2021, but on March 2, and at the time of release, it was free via PS Plus. Puzzle adventure with Metacritic scores ranging from 70 to 71.</p><p>What do you think about this?</p>','PLAYSTATION 0 - XBOX 3','',_binary '<p>The fight for players is getting tougher. Who loses, the brands or the players, we think it\'s clear,</p><p>Three games that can only be played on PC, PS4 and PS5 are moving to Xbox One, Xbox Series S and Xbox Series X.</p><p>The first of these three games is The Pathless. The action-adventure game developed by Giant Squid, The Pathless, was released on November 12, 2020 as a PS5 game.</p><p>The second game is Solar Ash, released on December 2, 2021 and coming to us from the Heart Machine development team. The sci-fi action adventure had a good score of 78 on Metacritic.</p><p>The third and final game so far is Maquette from developer Graceful Decay. It was released in 2021, but on March 2, and at the time of release, it was free via PS Plus. Puzzle adventure with Metacritic scores ranging from 70 to 71.</p><p>What do you think about this?</p>','2022-08-16 11:01:34.223',0,0),(3,'FAN WORK ON RESIDENT EVIL UNREAL ENGINE 5','the story also depends on who is telling it... Or making it',_binary '<p>Despite the problems and setbacks when the series began to turn more towards action in the fifth and sixth installments, Resident Evil is back in top form. As well as being one of the most successful horror franchises in the industry, known for one of the most iconic save features in games, it has tweaked the classic formula to keep things fresh and has had a number of well-received remakes.</p><p>The first parts have been successfully brought back to life with more modern development methods, and it seems that another new old story is on the way. That is, the unofficial remake of Resident Evil is currently being worked on by an independent team. DSO Gaming spotted a short trailer showing how it\'s been done so far. The most interesting thing about this fan-made project is that it runs in Unreal Engine 5 and will apparently retain the fixed camera angles and tank controls of the original classic. Because of the engine it\'s being developed in, it looks pretty good so far.</p><p>At the time of writing, there doesn\'t seem to be a release date for this remake.</p><p>Fans always want to show their love for this long-running and influential franchise. There\'s a recent Resident Evil 9 concept video that fantastically showcases a possible scenario where the games\' main tyrants return, as well as a number of community-created remakes.</p><p>It\'s clear that the RE games have left a lasting impression on the gaming world, and players just want to see more stories from the main story.</p><p>Now seems like a good time to be a RE fan.</p><p>With Capcom working on a remake of Resident Evil 4, plus we have rumors that RE9 is officially in development, the classic horror franchise is by no means finished. Since the game was rebooted in 2017, taking it away from the action-oriented fifth and sixth installments, there has been a resurgence of interest in Resident Evil in general. This has been seen not only in the success of 2021\'s Village, but also in how fans want to get in on the action and create their own remakes and remasters.</p><p>Resident Evil was originally released in 1996 on the PlayStation and was later ported to the Nintendo DS, PC and Sega Saturn.</p>','FAN WORK ON RESIDENT EVIL UNREAL ENGINE 5','the story also depends on who is telling it... Or making it',_binary '<p>Despite the problems and setbacks when the series began to turn more towards action in the fifth and sixth installments, Resident Evil is back in top form. As well as being one of the most successful horror franchises in the industry, known for one of the most iconic save features in games, it has tweaked the classic formula to keep things fresh and has had a number of well-received remakes.</p><p>The first parts have been successfully brought back to life with more modern development methods, and it seems that another new old story is on the way. That is, the unofficial remake of Resident Evil is currently being worked on by an independent team. DSO Gaming spotted a short trailer showing how it\'s been done so far. The most interesting thing about this fan-made project is that it runs in Unreal Engine 5 and will apparently retain the fixed camera angles and tank controls of the original classic. Because of the engine it\'s being developed in, it looks pretty good so far.</p><p>At the time of writing, there doesn\'t seem to be a release date for this remake.</p><p>Fans always want to show their love for this long-running and influential franchise. There\'s a recent Resident Evil 9 concept video that fantastically showcases a possible scenario where the games\' main tyrants return, as well as a number of community-created remakes.</p><p>It\'s clear that the RE games have left a lasting impression on the gaming world, and players just want to see more stories from the main story.</p><p>Now seems like a good time to be a RE fan.</p><p>With Capcom working on a remake of Resident Evil 4, plus we have rumors that RE9 is officially in development, the classic horror franchise is by no means finished. Since the game was rebooted in 2017, taking it away from the action-oriented fifth and sixth installments, there has been a resurgence of interest in Resident Evil in general. This has been seen not only in the success of 2021\'s Village, but also in how fans want to get in on the action and create their own remakes and remasters.</p><p>Resident Evil was originally released in 1996 on the PlayStation and was later ported to the Nintendo DS, PC and Sega Saturn.</p>','2022-08-15 12:08:05.232',0,0),(4,'TINY TINA WONDERLANDS','What is certain is that the level of dopamine increases during the whole game, keeping you awake and active, almost \"on tingles\". If this is what you need, Tiny Tina Wonderlands is the right overworld for you.',_binary '<p>BORDERLANDS</p><p>Let\'s go back in time first, shall we? \"Little\" is a relative term, and for me it has been here for more than a decade. Thirteen years, to be exact. In 2009, Gearbox Software, in cooperation with 2K Games, created and published the forerunner of the aforementioned game under the name Borderlands. Good and evil, heroes and enemies, battles and fighters, losses and victories - every game has all these elements, right? However, not every game gets nearly as much credit or recognition as Borderlands.</p><p>IS IT WORTH PLAYING?</p><p>This March, Borderlands is getting a new sequel â€“ Tiny Tina Wonderlands. And this game is accompanied by a well-known dilemma: is it worth playing? Apart from similar associations to the very mention of the game (one can say prejudice), it features many famous characters as well as the way of playing. It also brings some innovations, but retains the spirit and many features of its predecessors, so it\'s no wonder that this dilemma persists even now. The chip doesn\'t fall far from the log, does it? Especially if its creators don\'t want it, but stick firmly to their standards.</p><p>This is, in a way, a good thing - they think there are good sides to their standards, and by that they mean that the standards are quite different from anything else in the gaming world. And why change something, if it still has an effect?</p><p>THE PLAYERS</p><p>You can play the game alone or with up to three players, but even when playing with someone, you retain some of your individuality and uniqueness. By that I mean that the team doesn\'t play that big of a role here; everyone has their own imagination that they use to create their own path, strategy and game plan, so they don\'t depend on the rest of the team.</p><p>While in some games communication, teamwork, knowing your teammates, their flaws and weaknesses are crucial, this is not the case here. Everyone is their own, in a way, a bit narcissistic and self-sufficient.</p><p>In addition, anyone can make their character exactly how they want it, if we consider that every aspect of physical appearance is taken into account.</p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>WEAPON</p><p>What especially attracts attention are weapons that can completely change the way of playing, as well as the course of the fight. And everything changes quite quickly. If, for example, you choose a hammer instead of a gun, the way you move, kill, how enemies die - everything changes. Although, this is also known from previous games from this franchise. A newspaper is a book of spells. Acts are fun and contextually relevant, tailored to the story and substance. They can be used on individual enemies as well as groups of them.</p><p>ENEMIES</p><p>What has angered and disappointed many is that there isn\'t a huge variety of enemies. Although everything changes quickly and often, the enemies remain similar from the beginning to the end of the gameplay. They don\'t all increase in strength like in many games, they don\'t get stronger over time, they stay the same, which is frustrating. If you already level up, the fight should be harder, right? Yes, there are bigger bosses with unique characteristics, but those opportunities are quite rare. This is precisely why this latest game in the franchise feels easier than the previous ones.</p><p>THE ENVIRONMENT</p><p>One of the more interesting details is the environment itself - juice and popcorn everywhere in this \"world\", pointing to the fact that, as one of the players said, at the end of the day, this is all just fun between friends.</p><p>In addition to this, everything is quite colorful, vivid, creative, full of small details that sometimes distract attention. At least until you get used to them, especially if you\'re used to drier locations.</p><p>Beanstalks, greenery, rivers, bays, old buildings and friendly cyclops eager to explore the archeology of their place are things you can expect to see at every turn.</p>','TINY TINA WONDERLANDS','What is certain is that the level of dopamine increases during the whole game, keeping you awake and active, almost \"on tingles\". If this is what you need, Tiny Tina Wonderlands is the right overworld for you.',_binary '<p>BORDERLANDS</p><p>Let\'s go back in time first, shall we? \"Little\" is a relative term, and for me it has been here for more than a decade. Thirteen years, to be exact. In 2009, Gearbox Software, in cooperation with 2K Games, created and published the forerunner of the aforementioned game under the name Borderlands. Good and evil, heroes and enemies, battles and fighters, losses and victories - every game has all these elements, right? However, not every game gets nearly as much credit or recognition as Borderlands.</p><p>IS IT WORTH PLAYING?</p><p>This March, Borderlands is getting a new sequel â€“ Tiny Tina Wonderlands. And this game is accompanied by a well-known dilemma: is it worth playing? Apart from similar associations to the very mention of the game (one can say prejudice), it features many famous characters as well as the way of playing. It also brings some innovations, but retains the spirit and many features of its predecessors, 