ing to the end of the gameplay. They don\'t all increase in strength like in many games, they don\'t get stronger over time, they stay the same, which is frustrating. If you already level up, the fight should be harder, right? Yes, there are bigger bosses with unique characteristics, but those opportunities are quite rare. This is precisely why this latest game in the franchise feels easier than the previous ones.</p><p>THE ENVIRONMENT</p><p>One of the more interesting details is the environment itself - juice and popcorn everywhere in this \"world\", pointing to the fact that, as one of the players said, at the end of the day, this is all just fun between friends.</p><p>In addition to this, everything is quite colorful, vivid, creative, full of small details that sometimes distract attention. At least until you get used to them, especially if you\'re used to drier locations.</p><p>Beanstalks, greenery, rivers, bays, old buildings and friendly cyclops eager to explore the archeology of their place are things you can expect to see at every turn.</p>','2022-08-10 19:34:25.145',1,0);
INSERT INTO `news_articles` VALUES (5,'The first Starfield gameplay: Build, crew and actually fly a spaceship','You build, crew and actually fly a spaceship',_binary '<p style=\"text-align: center;\">The Xbox and Bethesda Showcase has finally delivered what everyone has been waiting for so long!</p><p style=\"text-align: center;\">Fans finally got what they\'ve been wanting since 2018. The first trailer for the Starfield game is here. Bethesda also answered some burning questions about space travel, planetary exploration, and more. For those wondering if planets will function like Skyrim dungeons with separate instances representing a small playable area, they won\'t.</p><p style=\"text-align: center;\">Starfield will have 100 different star systems and over 1000 different planets. And according to Todd Howard, all of those planets will be fully explorable. Land anywhere, on any planet, get out and start exploring.</p><p style=\"text-align: center;\">We see some things about the game from the trailer. The player lands on a new planet, observes some alien life forms and mines some resources from a stone wall. He then finds a facility under pirate control. There is gunplay, grenades are thrown, and a space rifle is used to finish off bandits. The player finds new weapons before facing more pirates outside, using the jetpack to launch himself across the gap and engage more enemies. The action then shifts to the capital, New Atlantis, to meet a few NPCs and have a brief discussion about mysterious artifacts and \"visions.\"</p><p><img src=\"data:image/jpeg;base64,\"></p><p style=\"text-align: center;\">After that, Todd Howard takes a look at Starfield\'s character creation tools and starting traits, which include pros and cons, and the skill system you unlock as you level up. And finally the long-standing question was answered.</p><p style=\"text-align: center;\">You\'ll be able to build your own spaceship and populate it with NPCs of your choice.</p><p style=\"text-align: center;\">And yes, you can fly. You can really fly!</p><p style=\"text-align: center;\">Ship-to-ship combat in space? Confirmed.</p><p style=\"text-align: center;\">The spaceship has been speculated to serve as a loading screen or fast travel point, but the trailer shows how it actually moves, from system to system and planet to planet. We were expecting Skyrim in space, but... It looks more like Fallout in space.</p><p><img src=\"data:image/jpeg;base64,\"></p><p style=\"text-align: center;\">One thing is certain for now: with 1000 different planets, it looks much bigger than any Bethesda RPG to date.</p><p style=\"text-align: center;\">It\'s been a long wait, hasn\'t it? It was first announced at Bethesda\'s E3 press conference back in 2018. It took another three years before the official theatrical teaser trailer was shown in June 2021. It was originally scheduled to be released on 11/11. 22, and Bethesda announced in May that Starfield would be delayed until 2023.</p><p style=\"text-align: center;\">We may still not be sure when we will play it, but at least we know what we will be able to play.</p><p style=\"text-align: center;\"><a rel=\"noopener noreferrer\" href=\"https://www.youtube.com/watch?v=zmb2FJGvnAw\">https://www.youtube.com/watch?v=zmb2FJGvnAw</a></p>','The first Starfield gameplay: Build, crew and actually fly a spaceship','You build, crew and actually fly a spaceship',_binary '<p style=\"text-align: center;\">The Xbox and Bethesda Showcase has finally delivered what everyone has been waiting for so long!</p><p style=\"text-align: center;\">Fans finally got what they\'ve been wanting since 2018. The first trailer for the Starfield game is here. Bethesda also answered some burning questions about space travel, planetary exploration, and more. For those wondering if planets will function like Skyrim dungeons with separate instances representing a small playable area, they won\'t.</p><p style=\"text-align: center;\">Starfield will have 100 differen